import Card from 'react-bootstrap/Card';
import ListGroup from 'react-bootstrap/ListGroup';

function KitchenSinkExample() {
  return (
    <div style={{ height: '100vh' }} className='d-flex justify-content-center align-items-center'>
    <Card style={{ width: '18rem' }}>
      <Card.Body>
        <Card.Title style={{ fontFamily: "sans-serif" }}>Card Title</Card.Title>
        <Card.Text style={{ fontFamily: "sans-serif" }}>
          Some quick example text to build on the card title and make up the
          bulk of the card's content.
        </Card.Text>
      </Card.Body>
      <ListGroup className="list-group-flush">
        <ListGroup.Item style={{ fontFamily: "sans-serif" }}>Cras justo odio</ListGroup.Item>
        <ListGroup.Item style={{ fontFamily: "sans-serif" }}>Dapibus ac facilisis in</ListGroup.Item>
        <ListGroup.Item style={{ fontFamily: "sans-serif" }}>Vestibulum at eros</ListGroup.Item>
        <ListGroup.Item>Vestibulum at eros</ListGroup.Item>
      </ListGroup>
    </Card>
    </div>
  );
}

export default KitchenSinkExample;
